import React, { createContext, useState } from "react";
export const SampleContext = createContext();
const TrialContext = (props) => {
  const [addr, setAddr] = useState("");
  return (
    <SampleContext.Provider
      value={{
        addr,
        setAddr
      }}
    >
      {props.children}
    </SampleContext.Provider>
  );
};
export default TrialContext;
